import './styles/Case_opened.css';
import tier1 from '../assets/frame/tier1.png';
import tier2 from '../assets/frame/tier2.png';
import tier3 from '../assets/frame/tier3.png';
import tier4 from '../assets/frame/tier4.png';
import tier5 from '../assets/frame/tier5.png';



function Case_opened(){
    return (
        <>
            <div class="opencase">
                <h1>Freecase1</h1>
                <img src="./img/case/freecase1.png" alt=""/>
                <button>Open $0.00</button>
            </div>
        
            <div class="case_item">
                <div class="image-container">
                    <img src="./img/skin/Freecase1/tier1/DE_BluePly.png" alt="" class="tier1"/>
                    <img src="./img/skin/Freecase1/tier1/glock_oxide.png" alt="" class="tier1"/>
                    
                    <img src="./img/skin/Freecase1/tier2/p2000_aced.png" alt="" class="tier2"/>
                    <img src="./img/skin/Freecase1/tier2/mac7_monster.png" alt="" class="tier2"/>
                    <img src="./img/skin/Freecase1/tier2/tec9_avalanche.png" alt="" class="tier2"/>
                    
                    <img src="./img/skin/Freecase1/tier3/glock_neonoir.png" alt="" class="tier3"/>
                    <img src="./img/skin/Freecase1/tier3/m4_rain.png" alt="" class="tier3"/>
                    <img src="./img/skin/Freecase1/tier3/mac10_fade.png" alt="" class="tier3"/>

                    <img src="./img/skin/Freecase1/tier4/awp_asiimov.png" alt="" class="tier4"/>
                    <img src="./img/skin/Freecase1/tier4/m4s4_rain.png" alt="" class="tier4"/>

                    <img src="./img/skin/Freecase1/tier5/karam_saber.png" alt="" class="tier5"/>
                    <img src="./img/skin/Freecase1/tier5/navaja_fade.png" alt="" class="tier5"/>
                </div>
            </div>
        </>
    );
}

export default Case_opened;
